## TASK

Connect the existing `SkillMarketplace.tsx` component to the new backend marketplace IPC commands.

### Context

The `SkillMarketplace.tsx` component exists at `src/components/mimic/SkillMarketplace.tsx` but currently uses mock/placeholder data. Sprint 26 delivered the backend IPC commands that are now ready for integration.

### Deliverable 1: Update `SkillMarketplace.tsx`

Modify the existing component to:

1. **Fetch Plugin List:**
   ```typescript
   import { invoke } from '@tauri-apps/api/core';
   
   // On mount, fetch the catalog
   const [plugins, setPlugins] = useState<MarketplaceEntry[]>([]);
   const [loading, setLoading] = useState(true);
   
   useEffect(() => {
     invoke<MarketplaceEntry[]>('synapse_marketplace_list')
       .then(setPlugins)
       .catch(console.error)
       .finally(() => setLoading(false));
   }, []);
   ```

2. **Install/Uninstall Handlers:**
   ```typescript
   const handleInstall = async (pluginId: string) => {
     await invoke('synapse_marketplace_install', { id: pluginId });
     // Refresh the list
   };
   
   const handleUninstall = async (pluginId: string) => {
     await invoke('synapse_marketplace_uninstall', { id: pluginId });
     // Refresh the list
   };
   ```

3. **Display Status:**
   - Show "Install" button for `status === 'available'`
   - Show "Uninstall" button for `status === 'installed'`
   - Show "Update Available" badge for `status === 'update_available'`
   - Show loading spinner during install/uninstall operations

4. **Type Definitions:**
   Add proper TypeScript interfaces matching the backend types (see SYSTEM_STATE.md).

### Deliverable 2: Create `MarketplaceBridge.ts`

